import React from 'react';
import { CardDeck, Card } from 'react-bootstrap';
import moment from 'moment';

const setProfilePic = (name, src) => {
            const myProfilePic = '/images/myProfilePage.png';
            const wysProfilePic = '/images/marisolProfile.png';
            if (name === "Whats-Your-Story-Website") {
                const cardImg = document.querySelector("Card.Img")
                console.log(cardImg)
                src={ wysProfilePic }
            }
        }

console.log(setProfilePic())
const Project = ({ projects }) => {
        console.log(projects)
    const project = projects.map( ({ name, language, description, homepage, html_url, updated_at }, i) => {
console.log(name)
        return (
            homepage ?
                <Card className="text-center" key={ i }>
                    <Card.Img variant="top" src=""/>
                    <Card.Body>
                        <Card.Title>{ name.split("-").join(" ") }</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">{ language }</Card.Subtitle>
                        <Card.Text>{ description }</Card.Text>
                    </Card.Body>
                    <Card.Body>
                        <Card.Link href={ homepage }>Webpage Link</Card.Link>
                        <Card.Link href={ html_url }>GitHub Link</Card.Link>
                    </Card.Body>
                    <Card.Footer>
                        <small className="text-muted">{ moment(updated_at).fromNow() }</small>
                    </Card.Footer>
                </Card>
            : null  
        )     
    })  

    return (
        <CardDeck>
           { project }
        </CardDeck>
    )
}

export default Project;
